  "==List of Covered Songs": [
    "==List of Songs"
  ],
  "==List of Songs": [
    "<span style=use>Usage</span>",
    "{{Playlist|<span style=ph>...</span>}}",
    "",
    "<span style=ex>Examples</span>",
    "{{Playlist|notice = forbid|content = ",
    "# \"Songtitle\" {{nnd|nndid}} (Translation) (Notes) -XXXXXX ver.- feat. [[Singer1]], [[Singer2]] and [[Singer3]] (YYYY.MM.DD) '''(Additional notes)'''",
    "# \n\"[https://www.youtube.com/watch?v=123ytnumber123 Suji Chigai]\n\" {{nnd|sm234567}} (Misguidance) (Parody of [[Suki Kirai]]) -Arrange ver.- feat. Kogeinu, [[Faneru]] and [[ASK]] (guest appearance) (2011.05.08)",
    "}}",
    "",
    "{{Playlist|content = ",
    "# \"Songtitle\" {{nnd|nndid}} (Translation) (Notes) -XXXXXX ver.- feat. [[Singer1]], [[Singer2]] and [[Singer3]] (YYYY.MM.DD) '''(Additional notes)'''",
    "# \n\"[https://www.youtube.com/watch?v=123ytnumber123 Suji Chigai]\n\" {{nnd|sm234567}} (Misguidance) (Parody of [[Suki Kirai]]) -Arrange ver.- feat. Kogeinu, [[Faneru]] and [[ASK]] (guest appearance) (2011.05.08)",
    "}}",
    "",
    "<span style=info>Information</span>",
    "・If singer forbids reprinting of their covers, use {{Playlist|notice = forbid|content = ...}}",
    "・You may add subsections for e.g. TmBox or Soundcloud covers. Use {{Playlist|notice = sitename|content = ...}}. Replace sitename with tmbox, koebu, voiceblog or soundcloud",
    "",
    "・Use romanization of song titles. If song is romanized to an English title use that",
    "  ・Like: Ikasama Life Game instead of Ikasama Raifu Geimu",
    "・You can link to reprints of songs with [https://www.youtube.com/watch?v=Q5L1wOojuLE Songtitle]",
    "・Use {{nnd|nndid}} to link to the original on NND",
    "  ・The NND ID often begins with sm or nm",
    "  ・For https://www.nicovideo.jp/watch/sm123456 use sm123456",
    "・Provide translations of the song title (optional)",
    "  ・Like: (Slowly getting faster and faster) for Dandan Hayaku Naru",
    "・You can also include additional",
    "  ・Like: (Parody of \"Songname\"), (Original), (Original with GigaP), (Anime OP/ED/Insert song/OST), (Bandname song)",
    "・If the song is a particular arrange or version, use hyphens like: -Band edition-, -Piano ver.-, -English ver.-, -Screamo Rearrange-",
    "・If the song features vocals of several singers use feat. to denote that",
    "  ・Like: feat. Soraru and [[Mafumafu]]",
    "・If the song features a lot of (i.e. more than 9) different singers, alternatively you can write (XX singers collab) in place of feat. XX, XX, XX and XX",
    "・Add the year in a (YYYY.MM.DD) format. Don't use reprint dates. Those are usually incorrect",
    "・If needed add additional notes such as '''(Deleted)''', '''(Not in Mylist)''', '''(Community & YT only)''', {{example|'''(Private)''' or '''(Unlisted)'''",
    "",
    "<span style=imp>Important</span>",
    "・If you're adding songs to a playlist, add the song to the song page as well, if it exists!"
  ],
